      out.write("ButtonExpand.prototype.handleKeydown = function (event) {\r\n");
      out.write("\r\n");
      out.write("  console.log('[keydown]');\r\n");
      out.write("\r\n");
      out.write("  switch (event.keyCode) {\r\n");
