      out.write("    case this.keyCode.RETURN:\r\n");
      out.write("\r\n");
      out.write("      this.toggleExpand();\r\n");
      out.write("\r\n");
      out.write("      event.stopPropagation();\r\n");
      out.write("      event.preventDefault();\r\n");
      out.write("      break;\r\n");
      out.write("\r\n");
      out.write("    default:\r\n");
      out.write("      break;\r\n");
      out.write("  }\r\n");
      out.write("\r\n");
      out.write("};\r\n");
      out.write("\r\n");
      out.write("ButtonExpand.prototype.handleClick = function (event) {\r\n");
      out.write("  this.toggleExpand();\r\n");
      out.write("};\r\n");
      out.write("\r\n");
      out.write("ButtonExpand.prototype.handleFocus = function (event) {\r\n");
      out.write("  this.domNode.classList.add('focus');\r\n");
      out.write("};\r\n");
      out.write("\r\n");
      out.write("ButtonExpand.prototype.handleBlur = function (event) {\r\n");
      out.write("  this.domNode.classList.remove('focus');\r\n");
      out.write("};\r\n");
      out.write("\r\n");
      out.write("/* Initialize Hide/Show Buttons */\r\n");
      out.write("\r\n");
      out.write("window.addEventListener('load', function (event) {\r\n");
