      out.write("\r\n");
      out.write("  for (var i = 0; i < buttons.length; i++) {\r\n");
      out.write("    var be = new ButtonExpand(buttons[i]);\r\n");
      out.write("    be.init();\r\n");
      out.write("  }\r\n");
      out.write("\r\n");
      out.write("}, false);\r\n");
      out.write("</script>\r\n");
